/**
 * Create New Raw Body
 * @author app2smile
 * @param {ArrayBuffer} header - unGzip Header
 * @param {ArrayBuffer} body - unGzip Body
 * @param {String} type - encoding type
 * @return {ArrayBuffer} new raw Body with Checksum Header
 */
function newRawBody({ header, body }, encoding = undefined) {
	// $.log(`‚ö† ${$.name}, Create New Raw Body`, "");
	// Header: 1‰ΩçÔºöÊòØÂê¶Ê†°È™åÊï∞ÊçÆ Ôºà0ÊàñËÄÖ1Ôºâ + 4‰Ωç:Ê†°È™åÂÄºÔºàÊï∞ÊçÆÈïøÂ∫¶Ôºâ
	const flag = (encoding == "gzip") ? 1 : (encoding == "identity") ? 0 : (encoding == undefined) ? 0 : header?.[0] ?? 0; // encoding flag
	const checksum = Checksum(body.length); // Ê†°È™åÂÄº‰∏∫Êú™ÂéãÁº©ÊÉÖÂÜµ‰∏ãÁöÑÊï∞ÊçÆÈïøÂ∫¶, ‰∏çÊòØÂéãÁº©ÂêéÁöÑÈïøÂ∫¶
	if (encoding == "gzip") body = pako.gzip(body); // gzipÂéãÁº©ÔºàÊúâÈóÆÈ¢òÔºåÂà´ÂéãÔºâ
	let rawBody = new Uint8Array(header.length + body.length);
	rawBody.set([flag], 0) // 0‰ΩçÔºöEncodingÁ±ªÂûãÔºåÂΩì‰∏∫1ÁöÑÊó∂ÂÄô, app‰ºöÊ†°È™å1-4‰ΩçÁöÑÊ†°È™åÂÄºÊòØÂê¶Ê≠£Á°Æ
	rawBody.set(checksum, 1) // 1-4‰ΩçÔºö Ê†°È™åÂÄº(4‰Ωç)
	rawBody.set(body, 5); // 5-end‰ΩçÔºöprotobufÊï∞ÊçÆ
	return rawBody;
	// ËÆ°ÁÆóÊ†°È™åÂíå (BÁ´ô‰∏∫Êï∞ÊçÆÊú¨‰ΩìÂ≠óËäÇÊï∞)
	function Checksum(num) {
		let arr = new ArrayBuffer(4); // an Int32 takes 4 bytes
		let view = new DataView(arr);
		// È¶ñ‰ΩçÂ°´ÂÖÖËÆ°ÁÆóËøáÁöÑÊñ∞Êï∞ÊçÆÈïøÂ∫¶
		view.setUint32(0, num, false); // byteOffset = 0; litteEndian = false
		return new Uint8Array(arr);
	};
};

